","keccak256":"0x0f633a0223d9a1dcccfcf38a64c9de0874dfcbfac0c6941ccf074d63a2ce0e1e","license":"MIT"},"contracts/Exchange.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./Wallet.sol";

/// @notice Library SafeMath used to prevent overflows and underflows
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Exchange is Ownable {
    using SafeMath for uint256; //for prevention of integer overflow
    //using MathMul for uint256;

    address public immutable Owner;
    address public ethToken = address(0);
    uint256 decimals = 10 ** 18;

    //Token Address List available in DEX
    address[] public tokenList;

    //s_orderBook mappping: tokenAddress -> Side -> Order Array
    mapping(address => mapping(uint256 => _Order[])) public s_orderBook;

    //Balance in DEX
    mapping(address => mapping(address => uint256)) public s_tokens; //tokenAdress -> msg.sender -> tokenAmt

    //Locked value in orders in DEX  user->Token->lockedAmount
    mapping(address => mapping(address => uint256)) public lockedFunds;

    mapping(address => mapping(uint256 => _filledOrder[]))
        public s_filledOrders;

    uint256 public s_orderId = 0;
    bool private s_isManual = true;

    //Structs representing an order that has unique id, user and amounts to give and get between two tokens to exchange
    struct _Order {
        uint256 id;
        Side side;
        address user;
        address tokenA;
        uint256 amountA;
        address tokenB;
        uint256 amountB;
        uint256 rate; // TokenB/TokenA = price in terms of TokenB
        uint256 originalAmountA;
        uint256 originalAmountB;
    }

    //For any order that is filled even if it is partially filled or fully filled
    struct _filledOrder {
        uint256 id;
        Side side;
        address user;
        address tokenA;
        address tokenB;
        uint256 amountFilled;
        uint256 fillRate;
        uint256 originalRate;
        uint256 originalAmountA;
        uint256 originalAmountB;
    }

    enum Side {
        BUY,
        SELL
    }

    //add events
    /// @notice Event when an order is placed on an exchange
    event Order(
        uint256 id,
        Side side,
        address user,
        address tokenA,
        uint256 amountA,
        address tokenB,
        uint256 amountB,
        uint256 rate,
        uint256 originalAmountA,
        uint256 originalAmountB
    );

    /// @notice Event when an order is cancelled
    event Cancel(
        uint256 id,
        Side side,
        address user,
        address tokenA,
        uint256 amountA,
        address tokenB,
        uint256 amountB,
        uint256 rate,
        uint256 originalAmountA,
        uint256 originalAmountB
    );

    event fillBuyOrder(
        uint256 id,
        address user,
        address tokenA,
        uint256 amountA,
        address tokenB,
        uint256 amountB,
        uint256 amountBought,
        uint256 fillBuyRate,
        uint256 originalBuyRate,
        uint256 originalAmountA,
        uint256 originalAmountB
    );

    event fillSellOrder(
        uint256 id,
        address user,
        address tokenA,
        uint256 amountA,
        address tokenB,
        uint256 amountB,
        uint256 amountSold,
        uint256 fillSellRate,
        uint256 originalSellRate,
        uint256 originalAmountA,
        uint256 originalAmountB
    );

    constructor() {
        Owner = msg.sender;
    }

    function createLimitBuyOrder(
        // TokenA/TokenB
        address _tokenA,
        uint256 _amountA,
        address _tokenB,
        uint256 _amountB,
        uint256 _rate
    ) external validToken(_tokenA) validToken(_tokenB) {
        //Amount user has deposited in the DEX must be >= value he wants to buy
        require(
            balanceOf(_tokenB, msg.sender).sub(
                getlockedFunds(msg.sender, _tokenB)
            ) >= _amountB,
            "Insufficient Tokens to make Limit Buy Order"
        );

        updateLockedFunds(msg.sender, _tokenB, _amountB, true);

        s_orderBook[_tokenA][uint256(Side.BUY)].push(
            _Order(
                s_orderId,
                Side.BUY,
                msg.sender,
                _tokenA,
                _amountA,
                _tokenB,
                _amountB,
                _rate,
                _amountA,
                _amountB
            )
        );

        emit Order(
            s_orderId,
            Side.BUY,
            msg.sender,
            _tokenA,
            _amountA,
            _tokenB,
            _amountB,
            _rate,
            _amountA,
            _amountB
        );

        s_orderId = s_orderId.add(1);
    }

    function createLimitSellOrder(
        address _tokenA,
        uint256 _amountA,
        address _tokenB,
        uint256 _amountB,
        uint256 _rate
    ) external validToken(_tokenA) validToken(_tokenB) {
        //Amount of tokens user deposit in DEX must be >= the amount of tokens they want to sell
        require(
            balanceOf(_tokenA, msg.sender).sub(
                getlockedFunds(msg.sender, _tokenA)
            ) >= _amountA,
            "Insufficient tokens to sell"
        );

        //Lock the funds (tokens) in the wallet
        updateLockedFunds(msg.sender, _tokenA, _amountA, true);

        s_orderBook[_tokenA][uint256(Side.SELL)].push(
            _Order(
                s_orderId,
                Side.SELL,
                msg.sender,
                _tokenA,
                _amountA,
                _tokenB,
                _amountB,
                _rate,
                _amountA,
                _amountB
            )
        );

        emit Order(
            s_orderId,
            Side.SELL,
            msg.sender,
            _tokenA,
            _amountA,
            _tokenB,
            _amountB,
            _rate,
            _amountA,
            _amountB
        );

        s_orderId = s_orderId.add(1);
    }

    function cancelOrder(
        Side side,
        uint256 _id,
        address _token
    ) public validOrder(_id, side, _token) validToken(_token) {
        _Order[] storage _order = s_orderBook[_token][uint256(side)];
        uint256 size = _order.length;
        _Order memory order;

        uint256 index;
        for (uint256 i = 0; i < size; i++) {
            if (_order[i].id == _id) {
                index = i;
                order = _order[i];
                break;
            }
        }

        //Manual cancellation of orders
        if (s_isManual) {
            require(msg.sender == order.user, "Not Order Owner");

            //Unlock funds
            if (side == Side.BUY) {
                updateLockedFunds(
                    msg.sender,
                    order.tokenB,
                    order.amountB,
                    false
                );
            } else if (side == Side.SELL) {
                updateLockedFunds(
                    msg.sender,
                    order.tokenA,
                    order.amountA,
                    false
                );
            }
        }

        for (uint256 j = index; j < size - 1; j++) {
            _order[j] = _order[j.add(1)];
        }
        delete _order[size.sub(1)];
        _order.pop();

        s_orderBook[_token][uint256(side)] = _order;

        emit Cancel(
            _id,
            order.side,
            order.user,
            order.tokenA,
            order.amountA,
            order.tokenB,
            order.amountB,
            order.rate,
            order.originalAmountA,
            order.originalAmountB
        );
    }

    function fillOrder(
        Side side,
        uint256 _id,
        address _token,
        uint256 _amount,
        uint256 _rate
    ) public validOrder(_id, side, _token) validToken(_token) {
        _Order[] memory _order = s_orderBook[_token][uint256(side)];
        _Order memory order;
        uint256 index;

        (order, index) = getOrderFromArray(_order, _id);

        require(order.amountA >= _amount, "Invalid Order Amount to fill");

        order.amountA = order.amountA.sub(_amount);
        order.amountB = order.amountB.sub(
            order.rate.mul(_amount).div(decimals)
        );
        s_orderBook[_token][uint256(side)][index].amountA = order.amountA;
        s_orderBook[_token][uint256(side)][index].amountB = order.amountB;

        if (side == Side.BUY) {
            updateLockedFunds(
                order.user,
                order.tokenB,
                (order.rate.mul(_amount)).div(decimals),
                false
            );

            s_filledOrders[order.user][0].push(
                _filledOrder(
                    _id,
                    side,
                    order.user,
                    order.tokenA,
                    order.tokenB,
                    _amount,
                    _rate,
                    order.rate,
                    order.originalAmountA,
                    order.originalAmountB
                )
            );

            emit fillBuyOrder(
                _id,
                order.user,
                order.tokenA,
                order.amountA,
                order.tokenB,
                order.amountB,
                _amount,
                _rate,
                order.rate,
                order.originalAmountA,
                order.originalAmountB
            );
        } else if (side == Side.SELL) {
            updateLockedFunds(order.user, order.tokenA, _amount, false);

            s_filledOrders[order.user][1].push(
                _filledOrder(
                    _id,
                    side,
                    order.user,
                    order.tokenA,
                    order.tokenB,
                    _amount,
                    _rate,
                    order.rate,
                    order.originalAmountA,
                    order.originalAmountB
                )
            );

            emit fillSellOrder(
                _id,
                order.user,
                order.tokenA,
                order.amountA,
                order.tokenB,
                order.amountB,
                _amount,
                _rate,
                order.rate,
                order.originalAmountA,
                order.originalAmountB
            );
        }

        if (order.amountA == 0) {
            s_isManual = false;
            cancelOrder(side, order.id, order.tokenA); //remove filled orders
            s_isManual = true;
        }
    }

    function matchOrders(
        address _token,
        uint256 _id,
        Side side
    ) external validOrder(_id, side, _token) validToken(_token) {
        uint256 saleTokenAmt;

        if (side == Side.BUY) {
            //Retrieve sell order to match
            _Order[] memory _sellOrder = s_orderBook[_token][1];
            for (uint256 i = 0; i < _sellOrder.length; i++) {
                //Retrieve buy order to be filled
                _Order[] memory _order = s_orderBook[_token][0];
                (_Order memory buyOrderToFill, ) = getOrderFromArray(
                    _order,
                    _id
                );
                //sell order hit buyer's limit price & tokenB matches
                if (
                    _sellOrder[i].rate <= buyOrderToFill.rate &&
                    buyOrderToFill.tokenB == _sellOrder[i].tokenB
                ) {
                    _Order memory sellOrder = _sellOrder[i];
                    //if buyer's amount to buy > seller's amount to sell
                    if (buyOrderToFill.amountA > sellOrder.amountA) {
                        saleTokenAmt = sellOrder.amountA;
                    }
                    //if seller's amount to sell >= buyer's amount to buy
                    else if (buyOrderToFill.amountA <= sellOrder.amountA) {
                        saleTokenAmt = buyOrderToFill.amountA;
                    }

                    //Verify current balance
                    require(
                        balanceOf(buyOrderToFill.tokenB, buyOrderToFill.user) >=
                            (saleTokenAmt.mul(sellOrder.rate)).div(decimals),
                        "Insufficient Buyer Token Balance"
                    );
                    require(
                        balanceOf(_token, sellOrder.user) >= saleTokenAmt,
                        "Insufficient Seller Token Balance"
                    );

                    //update orders
                    fillOrder(
                        Side.BUY,
                        _id,
                        _token,
                        saleTokenAmt,
                        sellOrder.rate
                    );
                    fillOrder(
                        Side.SELL,
                        sellOrder.id,
                        _token,
                        saleTokenAmt,
                        sellOrder.rate
                    );

                    //buyer update
                    updateBalance(
                        _token,
                        buyOrderToFill.user,
                        saleTokenAmt,
                        true
                    );
                    updateBalance(
                        buyOrderToFill.tokenB,
                        buyOrderToFill.user,
                        (sellOrder.rate.mul(saleTokenAmt)).div(decimals),
                        false
                    );

                    //seller update
                    updateBalance(_token, sellOrder.user, saleTokenAmt, false);
                    updateBalance(
                        sellOrder.tokenB,
                        sellOrder.user,
                        (sellOrder.rate.mul(saleTokenAmt)).div(decimals),
                        true
                    );
                }

                bool orderExist = orderExists(_id, side, _token);
                if (!orderExist) break;
            }
        } else if (side == Side.SELL) {
            //Retrieve buy order to match
            _Order[] memory _buyOrder = s_orderBook[_token][0];
            for (uint256 i = 0; i < _buyOrder.length; i++) {
                //Retrieve sell order to be filled
                _Order[] memory _order = s_orderBook[_token][1];
                (_Order memory sellOrderToFill, ) = getOrderFromArray(
                    _order,
                    _id
                );
                //sell order hit buyer's limit price
                if (
                    _buyOrder[i].rate >= sellOrderToFill.rate &&
                    _buyOrder[i].tokenB == sellOrderToFill.tokenB
                ) {
                    _Order memory order = _buyOrder[i];

                    //if seller's amount to sell > buyer's amount to buy
                    if (sellOrderToFill.amountA > order.amountA) {
                        saleTokenAmt = order.amountA;
                    }
                    //if buyer's amount to buy > seller's amount to sell
                    else if (sellOrderToFill.amountA <= order.amountA) {
                        saleTokenAmt = sellOrderToFill.amountA;
                    }
                    //Verify current balance
                    require(
                        balanceOf(_token, sellOrderToFill.user) >= saleTokenAmt,
                        "Insufficient Seller Token Balance"
                    );
                    require(
                        balanceOf(order.tokenB, order.user) >=
                            (saleTokenAmt.mul(order.rate)).div(decimals),
                        "Insufficient Buyer Token Balance"
                    );

                    //update orders
                    fillOrder(Side.SELL, _id, _token, saleTokenAmt, order.rate);
                    fillOrder(
                        Side.BUY,
                        order.id,
                        _token,
                        saleTokenAmt,
                        order.rate
                    );

                    //seller update
                    updateBalance(
                        _token,
                        sellOrderToFill.user,
                        saleTokenAmt,
                        false
                    );
                    updateBalance(
                        sellOrderToFill.tokenB,
                        sellOrderToFill.user,
                        (order.rate.mul(saleTokenAmt)).div(decimals),
                        true
                    );

                    //buyer update
                    updateBalance(_token, order.user, saleTokenAmt, true);
                    updateBalance(
                        order.tokenB,
                        order.user,
                        (order.rate.mul(saleTokenAmt)).div(decimals),
                        false
                    );
                }
                bool orderExist = orderExists(_id, side, _token);
                if (!orderExist) break;
            }
        }
    }

    function getOrderLength(
        Side side,
        address _token
    ) public view returns (uint256) {
        return s_orderBook[_token][uint256(side)].length;
    }

    function getOrder(
        address _token,
        uint256 index,
        Side side
    )
        public
        view
        returns (
            uint256, //id
            uint256, //Side
            address, //user
            address, //tokenA
            uint256, //amountA
            address, //tokenB
            uint256, //amountB
            uint256, //rate -> TokenB/TokenA
            uint256, //originalAmountA
            uint256 //originalAmountB
        )
    {
        _Order memory order = s_orderBook[_token][uint256(side)][index];
        return (
            order.id,
            uint256(order.side),
            order.user,
            order.tokenA,
            order.amountA,
            order.tokenB,
            order.amountB,
            order.rate,
            order.originalAmountA,
            order.originalAmountB
        );
    }

    function getFilledOrderLength(
        address _user,
        Side side
    ) public view returns (uint256) {
        return s_filledOrders[_user][uint256(side)].length;
    }

    function getFilledOrder(
        address _user,
        Side side,
        uint256 index
    )
        public
        view
        returns (
            uint256, //id
            uint256, //side
            address, //user
            address, //tokenA
            address, //tokenB
            uint256, //amountFilled
            uint256, //fillRate
            uint256, //originalRate
            uint256, //originalAmountA
            uint256 //originalAmountB
        )
    {
        _filledOrder memory filledOrder = s_filledOrders[_user][uint256(side)][
            index
        ];
        return (
            filledOrder.id,
            uint256(filledOrder.side),
            filledOrder.user,
            filledOrder.tokenA,
            filledOrder.tokenB,
            filledOrder.amountFilled,
            filledOrder.fillRate,
            filledOrder.originalRate,
            filledOrder.originalAmountA,
            filledOrder.originalAmountB
        );
    }

    function getOrderFromArray(
        _Order[] memory _order,
        uint256 _id
    ) public pure returns (_Order memory, uint256) {
        uint256 i = 0;
        _Order memory order;
        for (i; i < _order.length; i++) {
            if (_order[i].id == _id) {
                order = _order[i];
                break;
            }
        }
        return (order, i);
    }

    function orderExists(
        uint256 _id,
        Side side,
        address _token
    ) public view returns (bool) {
        _Order[] memory orders = s_orderBook[_token][uint256(side)];

        for (uint256 i = 0; i < orders.length; i++) {
            if (orders[i].id == _id) {
                return true;
            }
        }
        return false;
    }

    function getlockedFunds(
        address _user,
        address _token
    ) public view returns (uint256) {
        return lockedFunds[_user][_token];
    }

    function updateLockedFunds(
        address _user,
        address _token,
        uint256 _amount,
        bool isAdd
    ) public {
        if (isAdd) {
            lockedFunds[_user][_token] = lockedFunds[_user][_token].add(
                _amount
            );
        } else if (!isAdd) {
            lockedFunds[_user][_token] = lockedFunds[_user][_token].sub(
                _amount
            );
        }
    }

    //balance of specific tokens in the dex owned by specific user
    function balanceOf(
        address _token,
        address _user
    ) public view returns (uint256) {
        return s_tokens[_token][_user];
    }

    function updateBalance(
        address _token,
        address _user,
        uint256 _amount,
        bool isAdd
    ) public {
        if (isAdd) {
            s_tokens[_token][_user] = s_tokens[_token][_user].add(_amount);
        } else if (!isAdd) {
            s_tokens[_token][_user] = s_tokens[_token][_user].sub(_amount);
        }
    }

    function addToken(address _token) public onlyOwner {
        require(!isVerifiedToken(_token), "Token already verified");
        tokenList.push(_token);
    }

    function isVerifiedToken(address _token) public view returns (bool) {
        uint256 size = tokenList.length;

        for (uint256 i = 0; i < size; i++) {
            if (tokenList[i] == _token) return true;
        }
        return false;
    }

    modifier validOrder(
        uint256 _id,
        Side side,
        address _token
    ) {
        require(orderExists(_id, side, _token), "Invalid Order ID");
        _;
    }

    modifier validToken(address _token) {
        require(isVerifiedToken(_token), "Token unavailable in DEX");
        _;
    }
}
","keccak256":"0xa94d28d2d013412233d8517fef9f535481a472da8990de2dd7638d39b6568e1f","license":"MIT"},"contracts/Wallet.sol":{"content":"// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import "./interface/IERC20.sol";
import "./Exchange.sol";

/// @notice Library SafeMath used to prevent overflows and underflows
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract Wallet is Ownable {
    using SafeMath for uint256; //for prevention of integer overflow

    address public immutable Owner;

    //For prevention of reentrancy
    bool private locked;

    address public ethToken = address(0);
    address public aETH = address(0x22404B0e2a7067068AcdaDd8f9D586F834cCe2c5);

    Exchange tokens;
    IERC20 token;

    event Deposit(address token, address user, uint256 amount, uint256 balance);

    /// @notice Event when amount withdrawn exchange
    event Withdraw(
        address token,
        address user,
        uint256 amount,
        uint256 balance
    );

    constructor() {
        Owner = msg.sender;
    }

    function depositETH() external payable {
        tokens.updateBalance(ethToken, msg.sender, msg.value, true);

        emit Deposit(
            ethToken,
            msg.sender,
            msg.value,
            tokens.balanceOf(ethToken, msg.sender)
        );
    }

    function withdrawETH(uint256 _amount) external {
        require(
            tokens.balanceOf(ethToken, msg.sender).sub(
                tokens.getlockedFunds(msg.sender, ethToken)
            ) >= _amount,
            "Insufficient balance ETH to withdraw"
        );
        require(!locked, "Reentrant call detected!");
        locked = true;
        tokens.updateBalance(ethToken, msg.sender, _amount, false);
        locked = false;
        (bool success, ) = msg.sender.call{value: _amount}("");
        require(success, "failed to send amount");

        emit Withdraw(
            ethToken,
            msg.sender,
            _amount,
            tokens.balanceOf(ethToken, msg.sender)
        );
    }

    //from and transferFrom is from ERC20 contract
    //_token should be an ERC20 token
    function depositToken(
        address _token,
        uint256 _amount,
        uint256 _decimals
    ) external {
        require(_token != ethToken);
        require(
            tokens.isVerifiedToken(_token),
            "Token not verified on Exchange"
        );
        //need to add a check to prove that it is an ERC20 token
        token = IERC20(_token);

        //Requires approval first
        require(
            token.transferFrom(msg.sender, address(this), _amount),
            "No Approval yet"
        );
        uint256 decimals = 18;
        if (_decimals == 18) {
            tokens.updateBalance(_token, msg.sender, _amount, true);
        } else
            tokens.updateBalance(
                _token,
                msg.sender,
                _amount.mul(10 ** decimals.sub(_decimals)),
                true
            );

        emit Deposit(
            _token,
            msg.sender,
            _amount,
            tokens.balanceOf(_token, msg.sender)
        );
    }

    function withdrawToken(
        address _token,
        uint256 _amount,
        uint256 _decimals
    ) external {
        require(_token != ethToken);
        require(
            tokens.isVerifiedToken(_token),
            "Token not verified on Exchange"
        );

        require(
            tokens.balanceOf(_token, msg.sender).sub(
                tokens.getlockedFunds(msg.sender, _token)
            ) >= _amount,
            "Insufficient Tokens to withdraw"
        );
        require(!locked, "Reentrant call detected!");
        locked = true;

        token = IERC20(_token);
        uint256 decimals = 18;
        if (_decimals == 18) {
            tokens.updateBalance(_token, msg.sender, _amount, false);
            require(token.transfer(msg.sender, _amount));
        } else {
            tokens.updateBalance(
                _token,
                msg.sender,
                _amount.mul(10 ** decimals.sub(_decimals)),
                false
            );
            require(
                token.transfer(
                    msg.sender,
                    _amount.div(10 ** decimals.sub(_decimals))
                )
            );
        }

        locked = false;
        emit Withdraw(
            _token,
            msg.sender,
            _amount,
            tokens.balanceOf(_token, msg.sender)
        );
    }

    //from and transferFrom is from ERC20 contract
    //_token should be an ERC20 token
    function deposit_aETH(uint256 _amount) external {
        //need to add a check to prove that it is an ERC20 token
        token = IERC20(aETH);

        //Requires approval first
        require(
            token.transferFrom(msg.sender, address(this), _amount),
            "No Approval yet"
        );

        tokens.updateBalance(aETH, msg.sender, _amount, true);

        emit Deposit(
            aETH,
            msg.sender,
            _amount,
            tokens.balanceOf(aETH, msg.sender)
        );
    }

    function withdraw_aETH(uint256 _amount) external {
        require(
            tokens.balanceOf(aETH, msg.sender).sub(
                tokens.getlockedFunds(msg.sender, aETH)
            ) >= _amount,
            "Insufficient aETH to withdraw"
        );
        require(!locked, "Reentrant call detected!");
        locked = true;

        token = IERC20(aETH);
        tokens.updateBalance(aETH, msg.sender, _amount, false);
        require(token.transfer(msg.sender, _amount));

        locked = false;
        emit Withdraw(
            aETH,
            msg.sender,
            _amount,
            tokens.balanceOf(aETH, msg.sender)
        );
    }

    function updateExchangeAddress(
        address _exchangeAddress
    ) external onlyOwner {
        tokens = Exchange(_exchangeAddress);
    }
}
